//https://leetcode.com/problems/the-maze-ii
class Solution {
public:
    int shortestDistance(vector<vector<int>>& maze, vector<int>& start, vector<int>& destination) {
        int dx[] = {0, 0, 1, -1};
        int dy[] = {1, -1, 0, 0};//up, down, right, left
        priority_queue<tuple<int, int, int,int>, vector<tuple<int, int, int,int>>, greater<tuple<int, int, int,int>>> q;//move,x,y,index
        q.push({0, start[0], start[1], -1});
        vector<vector<vector<int>>> dist(maze.size(), vector<vector<int>>(maze[0].size(), vector<int>(4, INT_MAX)));
        while(!q.empty()){
            auto [move, r, c, index] = q.top();
            q.pop();
            if(r == destination[0] && c == destination[1]){
                return move;
            }
            for(int i=0; i<4; i++){
                if(index == 0 && i == 1)
                    continue;
                if(index == 1 && i == 0)
                    continue;
                if(index == 2 && i == 3)
                    continue;
                if(index == 3 && i == 2)
                    continue;
                int x = r + dx[i];
                int y = c + dy[i];
                int count = 0;
                while(x >= 0 && y >= 0 && x < maze.size() && y < maze[0].size() && maze[x][y] == 0){
                    x = x + dx[i];
                    y = y + dy[i];
                    count++;
                }
                x = x - dx[i];
                y = y - dy[i];
                if(dist[x][y][i] > move+count){
                    q.push({move+count, x,y,i});
                    dist[x][y][i] = move+count;
                }
            }
        }
        return -1;
    }
};
